import React from 'react';

class MyForm extends React.Component {
 render(){
    return (
        <div>
            <input type="text"/><br/>
            <input type="text"/><br/>
            <select>
            <option>one</option>
            <option>two</option>
            <option>three</option>
            </select><br/>
            <input type="button" value="submit"/>
        </div>
    );
 }
}
export class MyForm2 extends React.Component {
    render(){
       return (
           <div>
